export default function EsqueciSenha(){
    return (
        <div style={{display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', backgroundColor: 'white', width: 400, height: 400}}>
            <h1>Redefinição de senha!</h1>
            <p>Informe um email e enviaremos um link <br/> para recuperação da sua senha.</p>
            <div style={{display: 'flex', flexDirection: 'column', marginBottom: 25}}>
                <label> <b>Email</b> </label>
                <input />
            </div>
            <button style={{backgroundColor: '#6A0DAD', color: '#FFFFFF', width: 250, hover: '#580A91'}}>Enviar link de recuperação.</button>
        </div>
    )
}
